import React, { useState } from 'react';
import { Carousel } from 'react-bootstrap';

function Home(){
    const [index, setIndex] = useState(0);

    const handleSelect = (selectedIndex) => {
      setIndex(selectedIndex);
    };
  
    return (
        <div className="Bg">
        <Carousel activeIndex={index} onSelect={handleSelect}>
          <Carousel.Item>
          <img src={"https://codingapple1.github.io/shop/shoes1.jpg"} alt="First slide"></img>            
            <Carousel.Caption>
              <h3>First slide label</h3>
              <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img src={"https://codingapple1.github.io/shop/shoes2.jpg"} alt="Second slide"></img>
            <Carousel.Caption>
              <h3>Second slide label</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
          <img src={"https://codingapple1.github.io/shop/shoes3.jpg"} alt="Third slide"></img>
            <Carousel.Caption>
              <h3>Third slide label</h3>
              <p>
                Praesent commodo cursus magna, vel scelerisque nisl consectetur.
              </p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
        </div>
      );
}

export default Home;
